import React from 'react';
import Logo from '../data/logo.png';


const SimplePage = () => {
  return (
    <section className='bg-black-100  p-'>
      <div className='container border border-black'>
        <img src={Logo} alt='logo' />

      </div>
    </section>
  );
};

export default SimplePage;
